import React from "react";
import styled,{css} from "styled-components";
import toDoList from './toDoList';

const TodoBlock = styled.div`
  width: 900px;
  height: 900px;
  margin: 100px auto 100px auto;
  background-color: white;
  border-radius: 10px;
  .todoCont {
    margin-left: 36px;
    position: relative;
    .dateBox {
      padding-top: 60px;
      h1 {
        margin: 0;
      }
      h3 {
        margin-top: 12px;
        color: #868e96;
      }
    }
    .todoTitle {
      margin-top: 48px;
      color: #20c997;
      font-weight: bold;
    }
    hr {
      margin-top: 18px;
      margin-bottom: 18px;
    }
    .todoList {
      flex: 1;
  padding: 20px 32px;
  padding-bottom: 48px;
  overflow-y: auto;
    }
    .addTodoBox {
      position: absolute;
      bottom: -569px;
      left: 40%;
      width: 100px;
      height: 100px;
      border-radius: 50px;
      background-color: #20c997;
      text-align: center;
      .addTodo {
        font-size: 70px;
        color: white;
      }
    }
  }
`;

const Todo = () => {
  return (
    <TodoBlock>
      <div className="todoCont">
        <div className="dateBox">
          <h1>2022년 11월 2일</h1>
          <h3>수요일</h3>
        </div>
        <div className="todoTitle">
          <span>할 일 3개 남음</span>
        </div>
        <hr />
        <div className="todoList" >
          <toDoList text="똥 또 싸기" done = {true} />
        </div> 
        <div className="addTodoBox">
          <span className="addTodo">+</span>
        </div>
      </div>
    </TodoBlock>
  );
};

export default Todo;
